import Layout from '../components/layout';
import Head from 'next/head';

const About = () => (
   <Layout>
       <Head>
         <title>About</title>
      </Head>
      <div>
         <h1>About pages</h1>
         <h2>Ini Halaman About</h2>
         <p>About apapun sih ini mah bebas</p>
      </div>
   </Layout>
)

export default About;
